import React from 'react';
import StackTraceToggle from './StackTraceToggle';
import InfoToggle from './InfoToggle';
import StackTrace from './StackTrace';
import Info from './Info';

class Log extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    stackTraceChild(params) {
        this.setState({
            data : params
        })
    }

    render() {
        const categoryTags = this.props.categories.map((data, index) =>
            <a key={index} id={data} className='categoryTag'>{data}</a>
        );

        return (
            <div className='log'>
                <table className='logContents'>
                    <tbody>
                        <tr>
                            <td width="5%">{this.props.timeStamp}</td>
                            <td width="10%">
                                {categoryTags}
                            </td>
                            <td width="80%">{this.props.log}</td>
                            <td width="2.5%">
                                <StackTraceToggle/>
                            </td>
                            <td width="2.5%">
                                <InfoToggle/>
                            </td>
                        </tr>
                    </tbody>
                </table>
                <StackTrace trace={this.props.trace}/>
                <Info info={this.props.info}/>
            </div>
        );
    }
}

